import './App.css';
import ParamEditor from './components/ParamEditor';

function App() {

  const params = [
    { id: 1, name: 'Назначение', type: 'string' },
    { id: 2, name: 'Длина', type: 'string' },
  ];

  const initialModel = {
    paramValues: [{ paramId: 1, value: '' }, { paramId: 2, value: '' }],
  };

  return (
    <div className="App">
      <ParamEditor />
    </div>
  );
}

export default App;
